 the variable for derivative\n       Output: dFdx = first derivative of F\n    \"\"\"\n    c0 = 2. / 3.\n    dFdx = c0 / dx * (F[3: - 1] - F[1: - 3] - (F[4:] - F[:- 4]) / 8.)\n    return dFdx\n\n# py-bokeh is needed if you wanna see the perf report \nwith performance_report(filename=\"dask-report.html\"):\n    t = time.perf_counter()\n    # Construct a lazy task graph \n    \n    der = Derivee(gt, 1)\n    cpt =  da.linalg.norm(der, axis=(1,2))\n\n    #arrays.validate_contract()    \n    # Submit the task graph to the scheduler\n    s = client.persist(cpt, release=True)\n    arrays.validate_contract()   \n    \n    # Print the result, note that \"s\" is a future object, to get the result of the computation, we call `s.result()` to retreive it. \n    print(client.compute(s).result(), flush=True)    \n\n\n    \n# wait until computation is done\n#k = wait(s)\nprint(\"Done in \",time.perf_counter() -t,  flush=True)\nclient.shutdown()\n\n        &lt;/pre&gt;\n        "},"id":"1401","type":"Div"},{"attributes":{"bottom_units":"screen","coordinates":null,"fill_alpha":0.5,"fill_color":"lightgrey","group":null,"left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","syncable":false,"top_units":"screen"},"id":"1459","type":"BoxAnnotation"},{"attributes":{},"id":"1010","type":"LinearScale"},{"attributes":{},"id":"1442","type":"AllLabels"},{"attributes":{},"id":"1017","type":"BasicTicker"},{"attributes":{"axis":{"id":"1016"},"coordinates":null,"dimension":1,"group":null,"ticker":null,"visible":false},"id":"1019","type":"Grid"},{"attributes":{"bottom":{"field":"bottom"},"fill_color":{"field":"color"},"hatch_color":{"field":"color"},"left":{"field":"left"},"line_width":{"value":2},"right":{"field":"right"},"top":{"field":"top"}},"id":"1067","type":"Quad"},{"attributes":{},"id":"1008","type":"LinearScale"},{"attributes":{"coordinates":null,"group":null},"id":"1417","type":"Title"},{"attributes":{"fill_alp
